	public static List<Dendrogram> HAC(){
		// initialize all items as clusters
		List<Dendrogram> clustering = new ArrayList<Dendrogram>(FILES_LIMIT);
		for(int i = 0; i < FILES_LIMIT; i++){
			clustering.add(new Dendrogram(i));
		}
		
		// merge to one cluster
		double lastMergeDist = 0;					// STOPPING 1
		double maxMergeDistGap = 0;					// STOPPING 1
		final double MERGE_DIST_TRESHOLD = 0.1;		// STOPPING 2
		List<Dendrogram> bestClustering = new ArrayList<Dendrogram>(FILES_LIMIT);
		bestClustering.addAll(clustering);
		while(clustering.size() > 1){
			double minDist = Double.MAX_VALUE;
			int minA = 0, minB = 1;
			for(int ia = 0; ia < clustering.size(); ia++){
				for(int ib = ia+1; ib < clustering.size(); ib++){
					double d = UPGMA(clustering.get(ia), clustering.get(ib));
					if(d < minDist){
						minDist = d;
						minA = ia;
						minB = ib;
					}
				}
			}
			
//			// STOPPING 1: remember state before largest mergeing distance
//			if((minDist - lastMergeDist) > maxMergeDistGap){
//				maxMergeDistGap = minDist - lastMergeDist;
//				bestClustering = new ArrayList<Dendrogram>(clustering.size());
//				bestClustering.addAll(clustering);
//				System.out.println(maxMergeDistGap);
//			}
			
			// STOPPING 2: return if merge distance reaches treshold
			if(minDist > MERGE_DIST_TRESHOLD){
				return clustering;
			}
			
			Dendrogram	a = clustering.get(minA),
						b = clustering.get(minB);
			Dendrogram newCluster = new Dendrogram(a, b, minDist);
			lastMergeDist = minDist;
			clustering.remove(minB);
			clustering.remove(minA);
			clustering.add(newCluster);
			
//			System.out.println("new cluster:" + newCluster.items);
		}
//		return bestClustering;		// STOPPING 1
		return clustering;			// STOPPING 2
	}
	
	public static double UPGMA(Dendrogram a, Dendrogram b){
		double dSum = 0;
		for(int ai : a.items){
			for(int bi : b.items){
				dSum += dist[ai][bi];
			}
		}
		return dSum / (double)(a.items.size() * b.items.size());
	}
	
	public static double cLink(Dendrogram a, Dendrogram b){
		double dMax = 0;
		for(int ai : a.items){
			for(int bi : b.items){
				dMax = Math.max(dMax, dist[ai][bi]);
			}
		}
		return dMax;
	}
	
	public static double sLink(Dendrogram a, Dendrogram b){
		double dMin = 0;
		for(int ai : a.items){
			for(int bi : b.items){
				dMin = Math.min(dMin, dist[ai][bi]);
			}
		}
		return dMin;
	}

